import axios from 'axios';
import {ITINERARY_ACQUIRED} from './types';

export const getItineraries = () => dispatch => {
    console.log("response");
    axios.get("/api/city").then(res => {
        console.log(res.data)
        dispatch({
        type: ITINERARY_ACQUIRED,
        payload: res.data
        })
    }
    );
};
